import React, { useState, useContext } from 'react';
import LogContext from '../ContextAPI/LogsAPI/LogContext';

const AddTech = () => {
    const context = useContext(LogContext);
    const {} = context;
    const [techdata, setTechdata] = useState({
        firstName: '',
        lastName: ''
    });
    const { firstName, lastName } = techdata;
    return (
        <div className='modal' id='add-tech'>
            <div className='modal-content'>
                <div className='row'>
                    <h4 className='blue-text left'>Add Technician :</h4>
                </div>
                <div className='row'>
                    <div className='input-field'>
                        <label className='active blue-text'>First Name</label>
                        <input type='text' value={firstName} name='firstName' />
                    </div>
                </div>
                <div className='row'>
                    <div className='input-field'>
                        <label className='active blue-text'>Last Name</label>
                        <input type='text' value={lastName} name='lastName' />
                    </div>
                </div>
            </div>
        </div>
    );
};

export default AddTech;
